export default [
    {
        path: '/login',
        name: '登录',
        component: () => import('@/views/common/login/Login.vue')
    },
    {
        path: '/register',
        name: '注册',
        component: () => import('@/views/common/login/Register.vue')
    },
    {
        path: '/exception/500',
        name: '500',
        component: () => import('@/views/common/exception/500.vue')
    },
    {
        path: '/exception/403',
        name: '403',
        component: () => import('@/views/common/exception/403.vue')
    },
    {
        path: '/exception/404',
        name: '404',
        component: () => import('@/views/common/exception/404.vue')
    }
]
